pragma solidity ^0.5.0;

import "./ConfigRole.sol";

contract Config is ConfigRole{	
    mapping (string => uint256) config;
    mapping (string => address) oracleAddress;
    mapping (string => address) tokenAddress;
    function getConfigValue(string memory key) public view returns (uint256) {
        return config[key];
    }

    function setConfigValue(string memory key, uint256 value) public onlyConfig returns (uint256) {
        config[key] = value;
        return config[key];
    }

    function getOracleAddress(string memory key) public view returns (address) {
        return oracleAddress[key];
    }

    function setOracleAddress(string memory key, address value) public onlyConfig returns (address) {
        oracleAddress[key] = value;
        return oracleAddress[key];
    }

    function getTokenAddress(string memory key) public view returns (address) {
        return tokenAddress[key];
    }

    function setTokenAddress(string memory key, address value) public onlyConfig returns (address) {
        tokenAddress[key] = value;
        return tokenAddress[key];
    }
}
